import React from 'react';

const Cv = () => {
return (
<div>
<h1>My CV</h1>
<p>Dale Warburton is an ambitious business and sales professional with a strong background in sales, marketing, and analysis. With a proven ability to drive sales revenue, solve problems strategically, and deliver strong performance measures, Dale excels in fostering lasting relationships and effective communication.</p>
<p>Recently, I  completed a coding bootcamp at CodeClan, where I gained expertise in various programming languages and technologies. studying Python, utilizing Flask for web development and SQL for database management. In addition, they learned JavaScript, using the Express framework and React library for web applications, and MongoDB for handling databases. Dale is now eager to transition into a new career in the coding industry and leverage their skills in these cutting-edge technologies.</p>
</div>
);
}

export default Cv;
